import React from "react";
import logo from './logo.svg';
import './App.css';
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import axios from 'axios';
import Header from "./Header";

function App() {
  const [dataWelcome, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((dataWelcome) => setData(dataWelcome.message));
  }, []);

  return (
    <div className="App">
      <Header/>
      <header className="App-header">
        <div className="welcome">
          <p>Welcome !</p>
          <NavLink to="/onehash"><button type="button" class="btn btn-primary">OneHash</button></NavLink>
        </div>
        <h1 class="server">{!dataWelcome ? "Loading..." : dataWelcome}</h1>
      </header>
    </div>
  );
}

export default App;
